      <div style="margin: 30px 0 100px 120px">
        <el-button size="large" @click="cancel">取消</el-button>
        <el-button v-if="viewOnly" size="large" icon="el-icon-edit" @click="edit()">编辑</el-button>
        <el-button
          v-if="!viewOnly"
          type="primary"
