          size="large"
          @click="save('save')"
          >保存为草稿</el-button
        >
        <el-button size="large" icon="el-icon-view" type="primary" @click="preview"
          >预览PDF</el-button
        >
        <el-button
          v-if="!(content || {}).gmtSubmitted"
