      />
      <attach-contract-template
        v-for="(item, index) in attachFormdata.attatchContracts"
        :key="index"
        :ref="`attachContractPdf${index}`"
        :content="item"
        :index="index"
        :flow-type="formData.flowType"
        :is-preview="isPreview"
