<script>
import { safeGet, safeParse } from '@/global/function/safe-operations'
import AttachContract from '@/page/manage/children/client/children/template-contract/components/attach-contract'
import AttachContractTemplate from '@/page/manage/children/client/children/template-contract/components/attach-contract-template'
import FirstPartyInput from '@/page/manage/children/client/children/template-contract/components/first-party-input'
import ajax from '@/api/ajax'
import moment from 'moment'
import FrameContractTemplate from '@/page/manage/children/client/children/template-contract/components/frame-contract-template.vue'
import Mixins from '../mixins/consts'
import { BUSSNESS_SCOPE_TYPE_1 } from '@/page/manage/children/client/children/template-contract/mixins/consts'
const img = `data:image/png;base64,`
function extractValues(json) {
  const values = []

  function traverse(obj) {
    for (let key in obj) {
      if (obj.hasOwnProperty(key)) {
        const value = obj[key]
        console.log('🎸 DEBUG_274 edit-dialog.vue 👉', value)
        if (typeof value === 'object') {
          traverse(value) // Recursively traverse nested objects
        } else {
          values.push(value)
        }
      }
    }
  }

  traverse(json)

  return values.join(' ')
}
function extractContent(node) {
  let content = ''

  for (let childNode of node.childNodes) {
    if (childNode.nodeType === Node.TEXT_NODE) {
      content += childNode.textContent
    } else if (childNode.nodeType === Node.ELEMENT_NODE) {
      content += extractContent(childNode)
    }
  }

  return content
}
const DEFAULT_FORM_DATA = JSON.stringify({
  flowType: 'framework',
  businessScope: BUSSNESS_SCOPE_TYPE_1.domestic,
  paymentMethod: '',
  firstParty: '',
  firstPartyAddress: '',
  firstPartyContact: '',
  firstPartyPhone: '',
  firstPartyEmail: '',
  secondParty: '',
  secondPartyContact: '',
  secondPartyPhone: '',
  secondPartyAddress: '浙江省杭州市西湖区蒋村街道双龙街99号三深商务中心B座6层612室',
  secondPartyEmail: '',
  serviceBegin: '',
  serviceEnd: '',
  activationDay: undefined,
  business: '',
  signDate: '',
  ossKey: '',
  myCompany: '',
  sendFirst: '',
  contractNo: '',
  orgId: '',
  deliveryAddress: '',
  requirementsForContract: '', // 合同盖章要求,
  requirementsForContractRemark: ''
})
export default {
  components: {
    FrameContractTemplate,
    AttachContract,
    AttachContractTemplate,
    FirstPartyInput
  },
  mixins: [Mixins],
  data() {
    return {
      isPreview: false,
      viewOnly: false,
      isAdd: true,
      visible: false,
      loading: null,
      downloadCount: 0,
      attachFormdata: {},
      formData: JSON.parse(DEFAULT_FORM_DATA),
      rules: {
        businessScope: {
          required: true,
          message: '请选择业务范围',
          trigger: 'submit'
        },
        flowType: {
          required: true
        },
        paymentMethod: {
          required: true,
          message: '请选择付款方式',
          trigger: 'submit'
        },
        firstParty: {
          required: true,
          message: '请输入甲方',
          trigger: 'submit'
        },
        firstPartyAddress: {
          required: true,
          message: '请输入甲方地址',
          trigger: 'submit'
        },
        firstPartyContact: {
          required: true,
          message: '请输入甲方联系人',
          trigger: 'submit'
        },
        firstPartyPhone: {
          required: true,
          message: '请输入甲方电话',
          trigger: 'submit'
        },
        firstPartyEmail: {
          required: true,
          message: '请输入甲方邮箱',
          trigger: 'submit'
        },
        myCompany: {
          required: true,
          message: '请选择乙方',
          trigger: 'submit'
        },
        secondPartyContact: {
          required: true,
          message: '请选择乙方联系人',
          trigger: 'submit'
        },
        secondPartyPhone: {
          required: true,
          message: '请选择乙方电话',
          trigger: 'submit'
        },
        secondPartyEmail: {
          required: true,
          message: '请选择乙方邮箱',
          trigger: 'submit'
        },
        serviceBegin: {
          required: true,
          message: '请选择服务期限开始日期',
          trigger: 'submit'
        },
        serviceEnd: {
          required: true,
          message: '请选择服务期限结束日期',
          trigger: 'submit'
        },
        requirementsForContract: {
          required: true,
          message: '请选择合同盖章要求',
          trigger: 'submit'
        },
        signDate: {
          required: true,
          trigger: 'submit',
          validator: (rule, value, callback) => {
            if (!value) {
              return callback('请选择合同签订日期')
            }
            if (!moment(value).isSameOrBefore(moment(this.formData.serviceBegin))) {
              return callback('合同签订日期必须早于或等于服务期限开始日期')
            }
            callback()
          }
        },
        activationDay: {
          required: true,
          message: '请输入激活宽限期',
          trigger: 'submit'
        },
        business: {
          required: true,
          message: '请输入业务',
          trigger: 'submit'
        },
        sendFirst: {
          required: true,
          message: '请选择谁先寄出',
          trigger: 'submit'
        },
        deliveryAddress: {
          required: true,
          message: '请输入收件人信息',
          trigger: 'submit'
        }
      },
      orgNameList: []
    }
  },
  computed: {
    title() {
      if (this.viewOnly) return '查看详情'
      return this.isAdd ? '新增' : '编辑'
    },
    isFlowTypeFirst() {
      return this.formData.flowType === 'framework'
    },
    attachContractAlias() {
      const { firstParty, orgId, myCompany, secondParty, signDate, sendFirst, deliveryAddress } =
        this.formData
      return {
        firstParty,
        orgId,
        myCompany,
        secondParty,
        signDate,
        sendFirst,
        deliveryAddress
      }
    }
  },
  methods: {
    edit() {
      this.viewOnly = false
    },
    cancel() {
      this.reset()
      this.visible = false
    },
    open(content) {
      this.content = content
      this.isAdd = !content
      this.visible = true
      this.viewOnly = false
      if (content) {
        this.viewOnly = !!content.viewOnly
        const info = safeParse(content.info, {})
        this.$nextTick(() => {
          this.formData = info
          info.list = this.normalizeProductInfo(info)
          this.formData.flowType = content.approvalType
          this.$refs.attachContract.setFormData(info)
          this.$nextTick(() => {
            this.attachFormdata = this.$refs.attachContract.getFormData()
          })
        })
      }
    },
    normalizeProductInfo(data) {
      const list = safeGet(data, 'list', [])
      return list.map((item) => {
        const productInfo = safeParse(item.productInfo, { list: [], headers: [] })
        return {
          ...item,
          list: productInfo.list,
          headers: productInfo.headers.filter((item) => item.value !== 'index')
        }
      })
    },
    businessScopeChange() {
      this.$nextTick(() => {
        this.$refs.attachContract.reset()
      })
      this.getCountryCode()
    },
    myCompanyChange(v) {
      if (!v) {
        this.formData.secondParty = ''
        return
      }
      this.formData.secondParty = this.secondPartyOptions1.find((item) => item.value === v).label
    },
    onFirstPartySelect(data) {
      const {
        address,
        id,
        orgAdmin: { name, phone, email }
      } = data
      this.formData = {
        ...this.formData,
        firstPartyAddress: address,
        firstPartyEmail: email,
        firstPartyPhone: '',
        firstPartyContact: name,
        orgId: id
      }
    },
    async getNo() {
      const res = await this.jaxLib.customer.oaContract.getContractNo({})
      if (safeGet(res, 'success', false)) {
        this.formData.contractNo = res.data
      }
    },
    onProgress() {},
    async hasDownloaded(e, name) {
      const { attatchContracts } = this.attachFormdata
      const file = new File([e], `${name}.pdf`, {
        type: 'application/pdf'
      })
      const formData = new FormData()
      formData.append('file', file)
      this.loading.setText(`生成合同文件中, ${this.downloadCount} / ${attatchContracts.length + 1}`)
      if (this.isPreview) {
        this.downloadCount++
        if (this.downloadCount === attatchContracts.length + this.isFlowTypeFirst ? 1 : 0) {
          this.loading.setText('预览文件生成成功')
          this.downloadCount = 0
          this.loading.close()
          return
        }
        return
      }
      const res = await ajax.common.ossUpload(formData)
      if (safeGet(res, 'success', false)) {
        this.downloadCount++
        if (name === 'frame') {
          this.formData.ossKey = res.data.filePosition
        } else {
          this.attachFormdata.attatchContracts[name].ossKey = res.data.filePosition
        }
        if (this.downloadCount === attatchContracts.length + this.isFlowTypeFirst ? 1 : 0) {
          this.loading.setText('合同文件生成成功，开始上传')
          this.downloadCount = 0
          await this.save('submit')
        }
      }
    },
    async validate() {
      try {
        await this.$refs.form.validate()
        await this.$refs.attachContract.validate()
        return Promise.resolve(true)
      } catch (e) {
        return Promise.resolve(false)
      }
    },
    async importFontFile(words) {
      console.log('🎸 DEBUG_630 edit-dialog.vue 👉', words)
      const res = await this.jaxLib.common.getExtractedFont({ words })
      const newStyle = document.createElement('style')
      newStyle.appendChild(
        document.createTextNode(
          `
            @font-face {
              font-family: "pdf-font";
              src: url("${res.data.name}")
            }
            `
        )
      )
      document.head.appendChild(newStyle)
    },
    async preview() {
      this.isPreview = true
      this.loading = this.$loading({
        lock: true,
        text: '生成中',
        spinner: 'el-icon-loading',
        background: 'rgba(0, 0, 0, 0.7)'
      })
      const valid = await this.validate()
      if (!valid) {
        this.$message.error('表单未填写完整，请填写好表单之后再进行预览')
        this.loading.close()
        return
      }
      this.attachFormdata = this.$refs.attachContract.getFormData()
      console.log('🎸 DEBUG_666 edit-dialog.vue 👉', this.attachFormdata)
      this.pdfGen()
    },
    async wordsExtraction() {
      let words = this.isFlowTypeFirst
        ? extractContent(this.$refs.frameContractPdf.$el).split('')
        : []
      this.attachFormdata.attatchContracts.forEach((item, index) => {
        words = words.concat(
          extractContent(this.$refs[`attachContractPdf${index}`][0].$el).split('')
        )
      })
      await this.importFontFile(Array.from(new Set(words)).join(''))
    },
    async pdfGen() {
      const viewport = document.querySelector('meta[name=viewport]')
      viewport.setAttribute(
        'content',
        'width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=0'
      )
      setTimeout(() => {
        this.$nextTick(async () => {
          await this.wordsExtraction()
          this.isFlowTypeFirst && this.$refs.frameContractPdf.generatePdf()
          this.attachFormdata.attatchContracts.forEach((item, index) => {
            this.$refs[`attachContractPdf${index}`][0].generatePdf()
          })
        })
      }, 500)
      viewport.setAttribute('content', 'width=device-width, initial-scale=1.0')
    },
    async save(type) {
      this.isPreview = false
      if (type !== 'save') {
        const valid = await this.validate()
        if (!valid) {
          this.$message.error('表单未填写完整，请检查')
          return
        }
      }
      this.loading = this.$loading({
        lock: true,
        text: '保存中',
        spinner: 'el-icon-loading',
        background: 'rgba(0, 0, 0, 0.7)'
      })
      this.attachFormdata = this.$refs.attachContract.getFormData()
      const { flowType } = this.formData
      if (type === 'readyToUpload') {
        this.loading.setText(
          `生成合同文件中, 0 / ${this.attachFormdata.attatchContracts.length + 1}`
        )
        this.isFlowTypeFirst && (await this.getNo())
        this.pdfGen()
        return
      }
      const flowAPIMap = this.isAdd
        ? {
            framework: 'saveOrSubmitProcessOne',
            attach: 'saveOrSubmitProcessTwo',
            attach_recharge: 'saveOrSubmitProcessTwo',
            attach_intl: 'saveOrSubmitProcessTwo'
          }
        : {
            framework: 'updateProcessOne',
            attach: 'updateProcessTwo',
            attach_recharge: 'updateProcessTwo',
            attach_intl: 'updateProcessTwo'
          }
      const params = this.genParams(type)
      const res = await this.jaxLib.customer.oaContract[flowAPIMap[flowType]](params)
      this.loading.close()
      this.loading = null
      if (safeGet(res, 'success', false)) {
        this.$message.success('操作成功')
        // this.back()
        this.reset()
        this.$emit('confirm')
        this.visible = false
      }
    },
    back() {
      this.$router.go(-1)
    },
    genParams(type) {
      const { flowType } = this.formData
      let params = {}

      if (flowType === 'framework') {
        params = {
          ...this.formData,
          list: this.attachFormdata.attatchContracts,
          type
        }
      } else if (['attach', 'attach_recharge', 'attach_intl'].includes(flowType)) {
        const spTypeMap = {
          attach: 'attach',
          attach_recharge: 'attach_recharge',
          attach_intl: 'attach_intl'
        }
        const {
          myCompany,
          sendFirst,
          spOrder,
          orgId,
          secondParty,
          firstParty,
          deliveryAddress,
          attatchContracts,
          signDate,
          remark,
          requirementsForContract,
          requirementsForContractRemark,
          businessScope
        } = this.attachFormdata
        console.log('🎸 DEBUG_777 edit-dialog.vue 👉', this.attachFormdata)
        params = {
          spType: spTypeMap[flowType],
          businessScope,
          signDate,
          myCompany,
          sendFirst,
          spOrder,
          orgId,
          secondParty,
          firstParty,
          deliveryAddress,
          list: attatchContracts,
          remark,
          type,
          requirementsForContract,
          requirementsForContractRemark
        }
      }
      return {
        ...params,
        id: (this.content || {}).id
      }
    },
    reset() {
      this.$refs.form.clearValidate()
      this.formData = JSON.parse(DEFAULT_FORM_DATA)
      this.content = null
      this.$refs.attachContract.reset()
    },
    async queryOrgAsync(queryString) {
      this.formData.orgName = ''
      const res = await this.jaxLib.customer.list.get(
        {
          pageIndex: 1,
          pageSize: 100,
          orgName: queryString,
          saler: ''
        },
        false
      )
      if (!res.success) return false
      this.orgNameList = res.data.list.map((e) => ({
        id: e.id,
        orgName: e.orgName
      }))
    }
  }
}
</script>
